INSERT INTO `cinestar`.`pelicula`  VALUES ('1', 'Arthur Fleck adora hacer reír a la gente, pero su carrera como comediante es un fracaso. El repudio social, la marginación y una serie de trágicos acontecimientos lo conducen por el sendero de la locura y, finalmente, cae en el mundo del crimen.', 'Drama', 'joker.jpg', 'Joker');
INSERT INTO `cinestar`.`pelicula`  VALUES ('2', 'La joven Maléfica crece para proteger su pacífico reino de los invasores, pero una terrible traición transforma su corazón puro en una piedra y la convierte en una criatura en busca de venganza.', 'Fantasía', 'malefica.jpg', 'Maléfica');
INSERT INTO `cinestar`.`pelicula`  VALUES ('3', 'Los Vengadores restantes deben encontrar una manera de recuperar a sus aliados para un enfrentamiento épico con Thanos, el malvado que diezmó el planeta y el universo.', 'Acción', 'avengersEndgame.jpg', 'Avengers: Endgame');
INSERT INTO `cinestar`.`pelicula`  VALUES ('4', 'David Dunn busca mantenerse un paso por delante de la ley mientras imparte justicia en las calles de Filadelfia. Sus talentos especiales pronto lo colocan en un curso de colisión con la Bestia, un loco psicótico que tiene una fuerza sobrehumana y 23 personalidades distintas. ', 'Terror', 'glass.jpg', 'Glass');
INSERT INTO `cinestar`.`pelicula`  VALUES ('5', 'Una guerrera extraterrestre de la civilización Kree se encuentra atrapada en medio de una batalla. Con la ayuda de Nick Fury trata de descubrir los secretos de su pasado mientras aprovecha sus poderes para terminar la guerra', 'Acción', 'capitanaMarvel.jpg', 'Capitana Marvel');
INSERT INTO `cinestar`.`pelicula`  VALUES ('6', 'Un joven une fuerzas con el detective Pikachu para desentrañar el misterio detrás de la desaparición de su padre. El dúo dinámico descubre una trama tortuosa querepresenta una amenaza para el universo Pokémon.', 'Fantasía', 'pikachuDetective.jpg', 'Pokemon: Detective Pikachu');
INSERT INTO `cinestar`.`pelicula`  VALUES ('7', 'Después de mudarse a una ciudad nueva, Karen le regala a su hijo Andy un muñeco que se convierte en el mejor amigo del niño. Lo que ellos desconocían es que el muñeco es un sermaligno que tiene vida propia. Andy deberá aliarse con otros niños vecinos para detener a esta diabólica criatura que está provocando muertes en la ciudad.', 'Terror', 'munecoDiabolico.jpg', 'Muñeco Diabólico');
INSERT INTO `cinestar`.`pelicula`  VALUES ('8', 'El dueño de un circo en aprietos contrata a un hombre y sus dos hijos para cuidar de un elefante recién nacido que puede volar, que pronto se convierte en la atracción principal que revitaliza al circo.', 'Fantasía', 'dumbo.jpg', 'Dumbo');
INSERT INTO `cinestar`.`pelicula`  VALUES ('9', 'Tree Gelbman vuelve a entrar en el bucle temporal para averiguar por qué entró la primera vez. Sin embargo, Lori ha resucitado y pretende vengarse de Tree.', 'Terror', 'felizMuerte2.jpg', 'Feliz dia de tu muerte 2');
INSERT INTO `cinestar`.`pelicula`  VALUES ('10', 'Alita es un cyborg que se despierta en la clínica de un médico sin recordar quién es. La cyborg deberá usar sus extraordinarias habilidades para combatir contra enemigos terribles, mientras trata de descubrir la verdad sobre su pasado.', 'Acción', 'alita.jpg', 'Alita: Ángel de combate');
